main:
	# Init the music player
	li $s0, 0
	#sw $s0, music_rt
	#la $s0, background_music
	#sw $s0, music_p

main_start:
	# draw start menu
	la $a0, menu_img
	li $a1, 0
	li $a2, 0
	jal draw_image
	# s2: the choice, 0: start, 1: exit
	li $s2, 0

main_menu_loop:
	jal frame_sync_init
	# Music!
	#jal play_music
	# Check keyboard
	li $s0, 0xffff0000
	lw $s1, 0($s0)
	bne $s1, 1, main_menu_loop_NXT
	lw $s1, 4($s0)
	beq $s1, 115, main_menu_loop_keyboard_press_s
	j main_menu_loop_NXT

main_menu_loop_keyboard_press_s:
	beqz $s2, main_init_game
	j main_EXIT

main_menu_draw:
	jal draw_image

main_menu_loop_NXT:
	jal frame_sync_delay
	j main_menu_loop

main_init_game:
    	li $a0, 0          # Posio inicial (altura = 0)
    	li $a1, 0          # Posio inicial (largura = 0)
    	li $a2, S_H        # Altura total da tela
    	li $a3, S_W        # Largura total da tela
	jal erase
	j main_EXIT

# -------------------------------------------------------------------
# draw_image
# a0: address of the image
# a1: start h
# a2: start w
# -------------------------------------------------------------------

draw_image:
	# t1, t2: dh, dw
	li $t1, 0
	# t3, t4: img_h, img_w
	lw $t3, 0($a0)
	lw $t4, 4($a0)
	# t5: reading address
	addi $t5, $a0, 8
draw_image_L1:
	# if dh >= img_h then break
	bge $t1, $t3, draw_image_L1_END
	# t0 = S_BS + ((a1 + t1) * S_W + a2) * 4 (the first writting address of this line)
	add $t0, $a1, $t1
	sll $t0, $t0, S_WB
	add $t0, $t0, $a2
	sll $t0, $t0, 2
	addi $t0, $t0, S_BS
	# Set t2 to 0
	li $t2, 0
draw_image_L2:
	# if dw >= img_w then break
	bge $t2, $t4, draw_image_L2_END
	# if dh + a1 < 0 or dh + a1 >= S_H then continue
	add $t6, $t1, $a1
	bltz $t6, draw_image_L2_NXT
	bge $t6, S_H, draw_image_L2_NXT
	# if dw + a2 < 0 or dw + a2 >= S_W then continue
	add $t6, $t2, $a2
	bltz $t6, draw_image_L2_NXT
	bge $t6, S_W, draw_image_L2_NXT
	# Copy the pixel
	lw $t6, 0($t5)
	sw $t6, 0($t0)
draw_image_L2_NXT:
	addi $t2, $t2, 1
	addi $t0, $t0, 4
	addi $t5, $t5, 4
	j draw_image_L2
draw_image_L2_END:
	addi $t1, $t1, 1
	j draw_image_L1
draw_image_L1_END:
	jr $ra

