# a1: start w
# a2: height
# a3: weidth
# -------------------------------------------------------------------
erase:
	# t1, t2: h, w
	move $t1, $a0
	# change a2, a3 to end h, end w
	add $a2, $a2, $a0
	add $a3, $a3, $a1
erase_L1:
	# if h >= a2 then break
	bge $t1, $a2, erase_L1_END
	# t0 = S_BS + (t1 * S_W + a1) * 4 (the first writting address of this line)
	move $t0, $t1
	sll $t0, $t0, S_WB
	add $t0, $t0, $a1
	sll $t0, $t0, 2
	addi $t0, $t0, S_BS
	# Set t2 to a1
	move $t2, $a1
erase_L2:
	# if w >= a3 then break
	bge $t2, $a3, erase_L2_END
	# if h < 0 or h >= S_H then continue
	bltz $t1, erase_L2_NXT
	bge $t1, S_H, erase_L2_NXT
	# if w < 0 or w >= S_W then continue
	bltz $t2, erase_L2_NXT
	bge $t2, S_W, erase_L2_NXT
	li $t3, C_BG
	sw $t3, 0($t0)
erase_L2_NXT:
	addi $t2, $t2, 1
	addi $t0, $t0, 4
	j erase_L2
erase_L2_END:
	addi $t1, $t1, 1
	j erase_L1
erase_L1_END:
	jr $ra

# -------------------------------------------------------------------
# add64
# A 64bit add algorithm
# v1:v0 = a1:a0 + a3:a2 (hi: v1, a1, a3; lo: v0, a0, a2)
# -------------------------------------------------------------------
add64:
	addu $v0, $a0, $a2
	nor $a2, $a2, $zero
	sltu $a2, $a2, $a0
	addu $v1, $a2, $a1
	addu $v1, $v1, $a3
	jr $ra

# -------------------------------------------------------------------
# frame_sync_init
# Init the system time for consistent frame rate
# -------------------------------------------------------------------
frame_sync_init:
	li $v0, 30
	syscall
	sw $a0, time_lo
	sw $a1, time_hi
	jr $ra

# -------------------------------------------------------------------
# frame_sync_delay
# -------------------------------------------------------------------
frame_sync_delay:
	# Save ra
	addi $sp, $sp, 4
	sw $ra, 0($sp)
	# Get current game time
	li $v0, 30
	syscall
	move $t0, $a0
	move $t1, $a1
	# Load last game time
	lw $t2, time_lo
	lw $t3, time_hi
	# Calculate the difference
	nor $a0, $t2, $zero
	nor $a1, $t3, $zero
	li $a2, 1
	li $a3, 0
	jal add64
	move $a0, $t0
	move $a1, $t1
	move $a2, $v0
	move $a3, $v1
	jal add64
	move $t0, $v0
	# Sleep(Delay - difference)
	li $v0, 32
	li $a0, DLY
	sub $a0, $a0, $t0
	# if a0 < 0 then set a0 = 0
	bgez $a0, frame_sync_delay_call
	li $a0, 0
frame_sync_delay_call:
	syscall
	# Load ra
	lw $ra, 0($sp)
	addi $sp, $sp, -4
	jr $ra

main_EXIT:
	# End program
	li $v0, 10
	syscall